import React from 'react';

class Ticket {
    public studentID: string | undefined;
    public studentName: string | undefined;
    public ticketType: string | undefined;
    public description: string | undefined;
    public location: string | undefined;
    public currentDate: Date | undefined;
  }

interface TicketListProps {
  tickets: Ticket[];
}


  // Handle form submission
  const handleDeleteTicket = (ticket: Ticket) => {
    const deleteTicket = 'http://localhost:8080/ticket/deleteTicket';

    const requestOptions = {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(ticket), 
      };


      // Make the API request
    fetch(deleteTicket, requestOptions)
    .then((response) => {
        if (!response.ok) {
        throw new Error('Network response was not ok');
        }
        return response.json();
    })
    .then((data) => {
        // Handle the API response data here
    })
    .catch((error) => {
        // Handle any errors that occurred during the fetch.
        console.error('Fetch error:', error);
    });



    // Add your login logic here
  };



const StaffTicketList: React.FC<TicketListProps> = ({ tickets }) => {
  return (
    <div className="ticket-form-container">
      <ul>
        {tickets.map((ticket) => (
                <li key={ticket.studentID}>
                <div className="ticket">
                    <strong>Student Name: {ticket.studentName}</strong>
                    <p>Description: {ticket.description}</p>
                    <div className="ticket-buttons">
                        <button className="assign-button">Assign Ticket</button>
                        <button className="edit-button">Edit Ticket</button>
                        <button className="delete-button" onClick={()=>handleDeleteTicket(ticket)}>Delete Ticket</button>
                    </div>
                </div>
                </li>
        ))}
      </ul>
    </div>
  );
};

export default StaffTicketList;
